CREATE TABLE "admission" (UNITID INTEGER PRIMARY KEY, OPENADMP INTEGER, ADMCON1 INTEGER, ADMCON2 INTEGER, ADMCON3 INTEGER, ADMCON4 INTEGER, ADMCON5 INTEGER, ADMCON6 INTEGER, ADMCON7 INTEGER, ADMCON8 INTEGER, ADMCON9 INTEGER);CREATE TABLE "codevalues" (fieldname TEXT, code INTEGER, value TEXT);CREATE TABLE "enrollment" (UNITID INTEGER REFERENCES "institution" (UNITID), EFYTOTLT INTEGER, EFFYLEV INTEGER, EFYTOTLM INTEGER, EFYTOTLW INTEGER, EFYAIANT INTEGER, EFYASIAT INTEGER, EFYBKAAT INTEGER, EFYHISPT INTEGER, EFYNHPIT INTEGER, EFYWHITT INTEGER, EFY2MORT INTEGER, EFYUNKNT INTEGER);CREATE TABLE "financial" (UNITID INTEGER PRIMARY KEY, UAGRNTP REAL, UAGRNTA REAL, UPGRNTT REAL, UPGRNTA REAL, UFLOANP REAL, UFLOANA REAL, ANYAIDP REAL);CREATE TABLE "institution" (UNITID INTEGER PRIMARY KEY UNIQUE, INSTNM TEXT, IALIAS TEXT, ADDR TEXT, CITY TEXT, STABRR TEXT, ZIP TEXT, LONGITUD REAL, LATITUD REAL, CBSATYPE INTEGER, LOCALE INTEGER, SECTOR INTEGER, HLOFFER INTEGER, WEBADDR TEXT);CREATE TABLE "room_and_board" (UNITID INTEGER PRIMARY KEY UNIQUE REFERENCES "institution" (UNITID), ROOM INTEGER, BOARD INTEGER, ROOMAMT REAL, BOARDAMT REAL, ALLONCAM INTEGER);CREATE TABLE "tuition" (UNITID INTEGER PRIMARY KEY UNIQUE REFERENCES "institution" (UNITID), TUITION1 REAL, FEE1 REAL, TUITION2 REAL, FEE2 REAL, TUITION3 REAL, FEE3 REAL);CREATE TABLE "version" (dataver REAL);